import React from 'react';
import { Text, View,SafeAreaView,StyleSheet } from 'react-native';

const SignUp = () => {
  return (
    <View style={StyleSheet.container}>
    <Text>hello</Text>
  </View>
  )
}

style = StyleSheet.create({
  container:{
    flex: 1, 
    justifyContent: "center",
     alignItems: "center",
  }

})
export default SignUp
